import React from 'react'
import './home.css';
import { Link } from "react-router-dom";

const cardNames = [
  {
    name: 'Students',
    path: '/students',
  },
  {
    name: 'Classrooms',
  },
  {
    name: 'Teachers',
  },
  {
    name: 'Classrooms',
  },
  {
    name: 'Sample',
  },
  {
    name: 'Sample',
  },
];
function home() {
  return (
    <div className="main">
      <div className="cardmain">
        {cardNames.map((card, index) => (
          <div key={index} className="card">
            {/* Check if a path is specified for the card */}
            {card.path ? (
              <Link to={card.path}>
                <h1>{card.name}</h1>
              </Link>
            ) : (
              <h1>{card.name}</h1>
            )}
          </div>
        ))}
      </div>
    </div>
  );
}


export default home
